import { Typography } from "@mui/material";
import { NavLink } from "react-router-dom";

const NavLinkComponent = ({ to, children }) => {
  return (
    <NavLink to={to}>
      {({ isActive }) => (
        <Typography
          color={isActive ? "text.disabled" : "text.primary"}
          sx={{ p: 2 }}
        >
          {children}
        </Typography>
      )}
    </NavLink>
  );
};
